package com.servinglynk.hmis.warehouse.report.scheduler.dao;import java.util.List;import org.springframework.transaction.annotation.Transactional;import com.servinglynk.hmis.warehouse.report.persistence.dao.core.QueryExecutor;import com.servinglynk.hmis.warehouse.report.persistence.entity.WorkerHeaderEntity;@Transactionalpublic class WorkerHeaderDao extends QueryExecutor implements IWorkerHeaderDao{	public List<WorkerHeaderEntity> findByExternalId(String externalId) {		WorkerHeaderEntity workerHeaderEntity = new WorkerHeaderEntity();		workerHeaderEntity.setExternalId(externalId);		workerHeaderEntity.setMaxRetry(5);		workerHeaderEntity.setRetryInterval(5);		workerHeaderEntity.setStatus("ACTIVE");		return (List<WorkerHeaderEntity>) findByExample(workerHeaderEntity);	}}